firstChar.code:
function firstChar(s) {
	if (typeof s !== 'string') return '';
    return s.charAt(0);
}

capitalize.code:
function capitalize(s) {
	if (typeof s !== 'string') return '';
    return s.charAt(0).toUpperCase() + s.slice(1);
}

parseInterface.code:
function parseInterface(data) {

    function capitalize(str) {
        if (typeof str !== "string") return "";
        return str.charAt(0).toUpperCase() + str.slice(1);
    }

    function capitalizeFielsKeys(obj) {
        const capObj = {};

        for (let key in obj) {
            if (typeof obj[key] === "array" || typeof obj[key] === "object") {
                capObj[capitalize(key)] = capitalizeFielsKeys(obj[key]);
            } else capObj[capitalize(key)] = obj[key];
        }
        return capObj;
    }

    return capitalizeFielsKeys(data);

}
